  return (
    <div>
    <MDBContainer className="mt-5">
      <DocsLink
        title="Registered students"

      />

            {this.state.list.map(item => {
              return (
                <li key={item.id}>
                  {item.value}
                  <button onClick={() => this.deleteItem(item.id)}>
                    Remove
                  </button>
                </li>
              );
            })}

      <p className=" text-center font-weight-bold">
        OOPS!!<br></br>
        NO DATA
